import React from 'react';

function EventList({ events }) {
  return (
    <div>
      <h2>Event List</h2>
      <ul>
        {events.map((event) => (
          <li key={event._id}>
            <strong>{event.title}</strong> - {event.description} ({event.date})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default EventList;
